import { useNavigate } from "react-router-dom";

function About() {
    const navigate = useNavigate();
    const clickHandler = () => {
        navigate("/product", { replace: true });
    };
    return (
        <>
            <button onClick={clickHandler}>Go to product</button>
            <p>About Page</p>
        </>
    );
}

export default About;
